package com.example.vpu2.appUi

import android.util.Log
import androidx.lifecycle.ViewModel
import androidx.lifecycle.viewModelScope
import com.example.vpu2.supabase.SupabaseClient
import io.github.jan.supabase.postgrest.Postgrest
import io.github.jan.supabase.postgrest.query.filter
import kotlinx.coroutines.flow.MutableStateFlow
import kotlinx.coroutines.flow.asStateFlow
import kotlinx.coroutines.launch
import kotlinx.serialization.Serializable

@Serializable
data class UArch(
 val name: String,
 val description: String? = null,
 val date: Long? = null,
 val images: List<String>? = null,
 val products: String? = null,
 val arch: String? = null
)

class MainViewModel : ViewModel() {

 private val _uArchData = MutableStateFlow<UArch?>(null)
 val uArchData = _uArchData.asStateFlow()

 private val _status = MutableStateFlow("Tap the button to fetch data.")
 val status = _status.asStateFlow()

 fun fetchUArchData(name: String) {
 viewModelScope.launch {
 _status.value = "Fetching..."
 try {
 val result = SupabaseClient.client.from("uarch").select {
 filter {
 eq("name", name)
 }
 }

 val selectedArchitecture = result.decodeList<UArch>().firstOrNull()

 if (selectedArchitecture != null) {
 _uArchData.value = selectedArchitecture
 _status.value = "Fetch successful!"
 } else {
 _uArchData.value = null
 _status.value = "Error: Record with name '$name' not found."
 }
 } catch (e: Exception) {
 Log.e("MainViewModel", "Error fetching data", e)
 _uArchData.value = null
 _status.value = "Error: ${e.message}"
 }
 }
 }

}
